import { Component } from "react";
import DataTable from 'react-data-table-component';

const data = [{ id: 1, title: 'Conan the Barbarian', year: '1982' } ];
const columns = [
  {
    name: 'Title',
    selector: 'title',
    sortable: true,
  },
  {
    name: 'Year',
    selector: 'year',
    sortable: true,
    right: true,
  },
];
 

class LPDT extends Component{
    render() {
        return (
          <DataTable
            title="Arnold Movies"
            columns={columns}
            data={data}
          />
        )
      }
};

export default LPDT;
